  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sand Lake NWR
  and the easement refuges outlines Refuge accomplishments from May through August
  of 1948. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and collections and receipts. Resource management
  is outlined; topics include grazing, haying, and fur harvesting. The public relations
  section of the report describes recreational uses and Refuge visitors. N-R forms
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
